import React, { Component } from 'react';
import './App.scss';
const props = {name:'Avishai', lastName:'Taashur'};
class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h2>Welcome to SEW JSON/HTML Tool</h2>
        </header>
        <p>{() => props.name}</p>
      </div>
    );
  }
}

export default App;
